/**
 * @param {string} s
 * @param {string[]} words
 * @return {number[]}
 */

const findSubstring = (s, words) => {
    let permutationSize = words.length * words[0].length;
    let wordSize = words[0].length;
    let wordsHash = {};
    let indexes = [];
    for (let word of words) {
        wordsHash[word] = wordsHash[word] + 1 || 1;
    }

    const checkValid = (i, hash) => {
        for (let index = i; index < i + permutationSize; index += wordSize) {
            let substring = s.slice(index, index + wordSize);

            if (!hash[substring]) {
                return false;
            } else {
                hash[substring] -= 1;
            }
        }

        return true;
    };

    for (let index = 0; index <= s.length - permutationSize; index++) {
        if (checkValid(index, { ...wordsHash })) {
            indexes.push(index);
        }
    }

    return indexes;
};

